import React from 'react';
import {BrowserRouter, Route, Switch} from 'react-router-dom';
import LandingPage from '../LandingPage/LandingPage';
import MapPage from './Compoennts/MapPage/MapPage';
import Uploader from './Compoennts/Uploader/Uploader';
import About from './Compoennts/'

function Router (props) {
    return (
        <BrowserRouter>
            <Switch>
                <Route exact path="/" render={() => <LandingPage/> }/>
                <Route path="/locations" render={() => <MapPage state={props.state} /> }/>
                <Route path="/about" render={() => <About /> }/>
                <Route path="/upload" render={() => <Uploader /> }/>
            </Switch>
        </BrowserRouter>
    )
}

export default Router;
